import React from "react";
import Auth from "../../utils/auth";
import love from '../../../public/images/heart.jpg';
import bad from '../../../public/images/Bad.jpg';
import Reviewform from "./ReviewForm";
import './style.css';

function Review() {
    if (Auth.loggedIn()) {
      return (
        <div id="reviewbox">
          <h2>"What did you think of this donut?"</h2>
          <button>
            <img src={love} alt="heart emoji" onClick={() => ReviewForm("love")} />
          </button>
          <button>
            <img src={bad} alt="thumbs down emoji" onClick={() => Reviewform("bad")} />
            </button></div>
      );
    }}
  
  export default Review;
